【商品説明】<BR>高い紫外線防御効果（SPF50＋、PA＋＋＋＋）とミネラルウォーターベースでみずみずしい使い心地を両立。<BR>コエンザイムQ10やヒアルロン酸を配合、エイジングケアをプラスしました。<BR>石けんですっきり簡単に落とせます。<BR><BR>商品サイズ：95×178×25<BR><BR>香り：無香料<BR><BR>成分：水、メトキシケイヒ酸エチルヘキシル、シリカ、シクロメチコン、エタノール、グリセリン、ＤＰＧ、ＢＧ、セパシン酸ジイソプロピル、ポリシリコーン－１５、カプリリルメチコン、オクトクリレン、ビスエチルヘキシルオキシフェノールメトキシフェニルトリアジン、ポリプチレングリコール／ＰＰＧ－９／１コポリマー、ジエチルアミノヒドロキシペンゾイル安息香酸ヘキシル、ｔ－ブチルメトキシジベンゾイルメタン、キサンタンガム、ユビキノン、ヒアルロン酸Ｎａ、塩化Ｍｇ、塩化Ｃａ、べへネスー２０、ＰＥＧ－１０ジメコチン、カンテン、（アクリル酸／アクリル酸アルキル（Ｃ－１０－３０））コポリマー、水酸化Ｋ、カルボマー、ＢＨＴ、トコフェロール、フェキシエタノール<BR><BR>ご使用上の注意等：・目に入らないようにご注意ください。目に入った場合は、すぐに水かぬるま湯で洗い流してください。<BR>・衣服についた場合はすぐに洗剤でていねいに洗ってください。洗う際には、ピンクに変色するおそれがありますので、塩素系漂白剤のご使用はさけてください。<BR>・傷やはれもの・湿しん・かぶれ・ただれ・色素異常などの症状がある部位にはお使いにならないでください。また、赤み・はれ・かゆみ・しげきなどの異常があらわれた場合は、ご使用をおやめください。続けてお使いになりますと悪化させることがあります。<BR><BR>原産国：日本<BR><BR>問い合わせ先：株式会社資生堂、東京都中央区銀座７－５－５、お客さま窓口　0120-81-4796<BR>商品区分：ＵＶ・日焼け止め<BR>JANコード：4901872876341<br><br><br><br>広告文責：アットライフ株式会社<br>TEL 079-280-2113<br>※商品パッケージは変更の場合あり。<br>メーカー欠品または完売の際、キャンセルをお願いすることがあります。ご了承ください。<style>
